import { createGlobalStyle } from "styled-components";

const GlobalStyle = createGlobalStyle`
*{
    font-size: 14px;


}

body {
	overflow-x: hidden;
    color: rgb (29, 29, 31);
    letter-spacing: -0.05em;
    background-color: #fff;

}

p{
    line-height:1.6;
}


`;

export default GlobalStyle;
